jQuery(function(){
	setInterval(function(){
		counterSecs++;
		if (restantes >= 0) {
			$("#saltarPubli_counter").html(restantes);
			restantes--;
		} else {
			$("#saltarPubli").html(goPlay);
		}
	},1000);
})
function saltarPubli(){
	if (counterSecs >= 10) {
		$("#adContainer").fadeOut("slow");
		setTimeout(function() {
			$("#adContainer").remove();
		},1000)
	}
}
